import './App.css';
import React, {Component} from 'react';

class App extends Component {

	state = {
		results: [],
		search: ''
	}

	editText = (e) => {
		this.setState({search: e.target.value})
	}

	render(){
		return(
			<div>
				<input type='text' value={this.state.search} onChange={this.editText}/>
			</div>
		)
	}
}

export default App;
